auto vector_mean(std::vector<auto> v) {
    auto sum = 0;
    for (auto i : v) {
        sum += i;
    }
    return sum / v.size();
}
auto vector_sum(std::vector<auto> v) {
    auto sum = 0;
    for (auto i : v) {
        sum += i;
    }
    return sum;
}

void test_time_of_generate_prime(int iters, int length) {
    std::cout<<"Begin test_time_of_generate_prime"<<std::endl;
    unsigned long long a;
    std::vector<time_t> v;
    std::time_t start_time;
    for (int i = 0; i < iters; i++) {
        start_time = std::time(nullptr);
        a = Goldwasser_Micali_Multithread::generate_prime_of_length_multithread(length);
        // std::cout << a << std::endl;
        v.push_back(std::time(nullptr) - start_time);
    }
    std::cout<<"Mean time for thread:\t"<<vector_mean(v)<<" seconds"<<std::endl;
    std::cout<<"Sum time for thread:\t"<<vector_sum(v)<<" seconds"<<std::endl;
    v.clear();
    for (int i = 0; i < iters; i++) {
        start_time = std::time(nullptr);
        a = Goldwasser_Micali_Multithread::generate_prime_of_length(length);
        // std::cout << a << std::endl;
        v.push_back(std::time(nullptr) - start_time);
    }
    std::cout<<"Mean time for single:\t"<<vector_mean(v)<<" seconds"<<std::endl;
    std::cout<<"Sum time for single:\t"<<vector_sum(v)<<" seconds"<<std::endl;
}

