//milliseconds
void test_time_of_GM_encode(int iters, int max_length_of_keys, std::string text) {
    std::cout<<"Begin test_time_of_GM_encode.\titers: "<<iters<<"\tmax_length_of_keys: "<<max_length_of_keys<<std::endl;
    std::vector<unsigned long long> ciphertext;
    std::vector<unsigned long long> timethread, timesingle;
    auto start_time =std::chrono::system_clock::now().time_since_epoch();
    std::string multithread_results;
    multithread_results = "iters,keys_length,mean_time,summarized_time\n";
    std::string singlethread_results;
    singlethread_results = "iters,keys_length,mean_time,summarized_time\n";
    for (int i = 2; i <= max_length_of_keys; i++) {
        for (int j = 0; j < iters; j++) {
            std::map<std::string, unsigned long long> key = Goldwasser_Micali_Multithread::GM_generate_key(max_length_of_keys, max_length_of_keys, true);
            ciphertext.clear();
            start_time = std::chrono::system_clock::now().time_since_epoch();
            ciphertext = Goldwasser_Micali_Multithread::GM_encode_multithread(text, key["x"], key["N"]);
            timethread.push_back(std::chrono::duration_cast<std::chrono::milliseconds>(std::chrono::system_clock::now().time_since_epoch() - start_time).count());
            ciphertext.clear();
            start_time = std::chrono::system_clock::now().time_since_epoch();
            ciphertext = Goldwasser_Micali_Multithread::GM_encode(text, key["x"], key["N"]);
            timesingle.push_back(std::chrono::duration_cast<std::chrono::milliseconds>(std::chrono::system_clock::now().time_since_epoch() - start_time).count());
        }

        multithread_results += std::to_string(iters) + "," + std::to_string(i) + "," + std::to_string(vector_mean(timethread)) + "," + std::to_string(vector_sum(timethread)) + "\n";
        singlethread_results += std::to_string(iters) + "," + std::to_string(i) + "," + std::to_string(vector_mean(timesingle)) + "," + std::to_string(vector_sum(timesingle)) + "\n";
        timethread.clear();
        timesingle.clear();
    }
    std::cout<<"multithread_results\n"<<multithread_results<<std::endl;
    std::cout<<"singlethread_results\n"<<singlethread_results<<std::endl;
}

