void example_polish_characters() {
    std::ofstream examplefile("examplepolish.txt");
    std::string stringpolish = "qwertyuiopasdfghjklzxcvbnm QWERTYUIOPASDFGHJKLZXCVBNM  ";
    examplefile<<"Tekst z polskimi znakami: "<<stringpolish<<std::endl;
    std::map<std::string, unsigned long long> keypolish;
    keypolish = Goldwasser_Micali_Multithread::GM_generate_key(3, 3, true);
    for (auto v:keypolish) {
        examplefile<<v.first<<" "<<v.second<<std::endl;
    }
    std::vector<unsigned long long> ciphertextpolish = Goldwasser_Micali_Multithread::GM_encode(stringpolish, keypolish["x"], keypolish["N"]);
    examplefile<<"Szyfr:"<<std::endl;
    for (auto v:ciphertextpolish) {
        examplefile<<v<<" ";
    }
    examplefile<<std::endl;
    std::string stringpolishdecoded = Goldwasser_Micali_Multithread::GM_decode(ciphertextpolish, keypolish["p"], keypolish["q"]);
    examplefile<<"Zdeszyfrowana wiadomo: "<<stringpolishdecoded<<std::endl;
    examplefile.close();
}

